import React from "react";
import "./filter.css";

const Filter = () => {
  return (
    <div>
      <div Filter__container>
        <div className="Filter__gender">
          <h4>Gender:-</h4>
          <label htmlFor="men">MEN</label>
          <input type="radio" value="men" id="men" />
          <br />
          <label htmlFor="women">WOMEN</label>
          <input type="radio" value="women" id="women" />
        </div>
        <div className="Fiter__categories">
          <h4>Categories:-</h4>
          <label htmlFor="white">White</label>
          <input type="radio" value="white" id="white" />
          <label htmlFor="folded">Folded Sleeves</label>
          <input type="radio" value="folded-sleeves" id="folded" />
        </div>
      </div>
    </div>
  );
};

export default Filter;
